    [],nt"revision_timestamp": "2015-03-13T03:15:57.180943",nt"name": "swan-river-national-wildlife-refuge-annual-narrative-report-calendar-year-1986",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Swan River
    National Wildlife Refuge outlines Refuge accomplishments during the 1986 calendar
    year. The report begins with Refuge highlights and information about climatic conditions.
    The land acquisition program and research and investigations are described. Administrative
    topics are discussed, including personnel, other manpower programs, volunteer programs,
    funding, safety, and technical assistance. Habitat management is covered; wetlands,
    forests, grasslands, grazing, haying, fire management, pest control, and water rights
    are discussed. The wildlife section of the report discusses endangered and threatened
    species, waterfowl, marsh and water birds, shorebirds, raptors, other migratory
    birds, game mammals, other resident wildlife, fishery resources, and scientific
    collections. Interpretation and recreation activities are outlined; topics include
    information and interpretation, hunting, fishing, trapping, wildlife observation,
    other wildlife oriented recreation, and law enforcement. New construction and equipment
    utilization and replacement is also covered. Cooperative programs are discussed.
    Photographs and brochures are attached.",nt"license_title": "License Not Specified",nt"extras":
